// Import React and any other necessary libraries
import React from 'react';
import './EventsPage.css'; // Make sure the CSS file is correctly linked

// Sample array of events
const events = [
  {
    id: 1,
    title: 'Irish Tap Dancing Class',
    location: 'Dublin Cultural Center',
    host: 'Irish Dance Academy',
    dateTime: '2024-03-17, 5:00 PM',
    attendees: 20,
    image: 'irish-dance.jpg', // Placeholder image path
  },
  {
    id: 2,
    title: 'Brazilian Music Festival',
    location: 'Rio de Janeiro Pavilion',
    host: 'Brazilian Beats Organization',
    dateTime: '2024-04-21, 8:00 PM',
    attendees: 150,
    image: 'brazilian-music.jpg', // Placeholder image path
  },
  // Add the rest of the events here...
];

const EventsPage = () => {
  return (
    <div className="events-page">
      {events.map((event) => (
        <div key={event.id} className="event-item">
          <img src={event.image} alt={event.title} className="event-image" />
          <div className="event-details">
            <h3>{event.title}</h3>
            <p>{event.location}</p>
            <p>Hosted by: {event.host}</p>
            <p>When: {event.dateTime}</p>
            <p>{event.attendees} people attending</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default EventsPage;
